import styled from "styled-components"

export const NavBar = styled.nav`
    background-color: var(--black);
    position: fixed;
    bottom: 0;
    width: 100%;
    height: 5rem;
    font-weight: 500;

    ul {
        list-style-type: none;
        display: flex;
        flex-direction: row;
        align-items: center;
    }
`
